			var select, current_length
			function first_yr_hist_select_value(){
				first_yr_hist_text.value = first_yr_hist_select.value
				document.getElementById('pr_climatol_title_hist_syr').innerHTML = first_yr_hist_select.value
				document.getElementById('tas_climatol_title_hist_syr').innerHTML = first_yr_hist_select.value
				first_yr_hist_select.style.visibility = 'hidden';
				first_yr_hist_select_visibility = 0;

				select = document.getElementById("last_yr_hist_select")
				current_length = select.options.length
				for (i=0; i<current_length-1; i++) {
					select.options[select.options.length-1] = null
				}

				select.options[select.options.length-1] = new Option(first_yr_hist_select.value, first_yr_hist_select.value);
				for (i=0; i<2005-first_yr_hist_select.value; i++) {
					select.options[select.options.length] = new Option(parseInt(first_yr_hist_select.value)+i+1, parseInt(first_yr_hist_select.value)+i+1);
				}
			}
